import React from 'react'
import { withRouter } from 'react-router-dom'

function Home() {

  return (
    <div>
      <h1>Welcome to next round!</h1>
      <button>Create Room</button>
      <button>Join Room</button> 
    </div>
  )
}

export default withRouter(Home)
